script: |
  super -f text -I q3762.spq | sort > q3762.out

inputs:
  - name: q3762.spq
    data: |
      SELECT ALL - col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE + ( - - col1 ) NOT BETWEEN - + col2 AND + col1 / col1 + + + col2 + + - 29 + - + 53;
  - name: tab2

outputs:
  - name: q3762.out
    data: |
      -46
      -64
      -75
